import React from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from '@mui/material';
import { TransferRecord } from '../services/storageService';

interface WorkflowDialogProps {
  open: boolean;
  onClose: () => void;
  employeeId: string;
  transfers: TransferRecord[];
}

const WorkflowDialog: React.FC<WorkflowDialogProps> = ({
  open,
  onClose,
  employeeId,
  transfers,
}) => {
  const employeeTransfers = transfers.filter(t => t.employeeId === employeeId);

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>Workflow History</DialogTitle>
      <DialogContent>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Date</TableCell>
                <TableCell>From Department</TableCell>
                <TableCell>To Department</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {employeeTransfers.map((transfer, index) => (
                <TableRow key={index}>
                  <TableCell>{transfer.date}</TableCell>
                  <TableCell>{transfer.fromDepartment}</TableCell>
                  <TableCell>{transfer.toDepartment}</TableCell>
                </TableRow>
              ))}
              {employeeTransfers.length === 0 && (
                <TableRow>
                  <TableCell colSpan={3} align="center">
                    No transfer history found
                  </TableCell>
                </TableRow>
              )}
            </TableBody>
          </Table>
        </TableContainer>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Close</Button>
      </DialogActions>
    </Dialog>
  );
};

export default WorkflowDialog;
